import React from 'react';
import styled from 'styled-components';
import { Title } from '../auth-info';

const Wrapper = styled.div`
  width: 844px;
  margin: 280px auto 50px;
  ${Title} {
    font-family: MuseoSans,sans-serif;
    font-weight: 900;
    font-size: 64px;
    line-height: 76px;
    color: #202d3d;
    span {
      color: #c000d9;
    }
  }
`
const Description = styled.div`
    display: flex;
    justify-content: space-between;
    margin-top: 40px;
`

export const StreamInfo = () => {
  return <Wrapper>
    <Title>
      Мобильный ID и <span>Stream</span>
    </Title>
    <Description>
      <div>
        <h5>Удобно</h5>
        <p>Позволит быстро войти в приложение и на веб-сайты по номеру телефона без необходимости запоминать сложные пароли и отдельные логины для разных сервисов</p>
      </div>
      <div>
        <h5></h5>
      </div>
    </Description>
  </Wrapper>
}
